from datetime import datetime
from dateutil import tz

def parse_iso8601(date_str, delimiter='T', timezone=None):
    """ Return a UNIX tinestamp from the given date.
        Delimiter corresponds to the time delimiter (e.g. 2023-10-19T00:00:00+0000)
    """

    try:
        dt = datetime.strptime(date_str, '%Y-%m-%d{}%H:%M:%S%z'.format(delimiter))
        if timezone:
            dt = dt.astimezone(tz.gettz(timezone))
        return str(int(dt.timestamp()))
    except ValueError:
        return None
